import React from "react";
import { useState } from "react";
import Item from "../../Molecules/Item/Item";

const List = ({Itemlist}) =>{
    const [List, setList] = useState([])

    return(
        <ul>
            {List.map(content => <li><Item text={content}/></li>)}
        </ul>
    )
}

export default List
